def Motif_in_DNA(x,y):
    temp = []
    count = 1
    j = len(y)

    for i in range(len(x)):
        i = i + 1
        j = j + 1
        if x[i:j] == t:
            count = i + 1
            temp.append(count)

    print(*temp)


if __name__ == "__main__":
    Motif_in_DNA(s,t)